import react from "react";
import { Carousel } from "react-bootstrap";
import ban1 from "./ban1.png";
import ban2 from "./ban2.png";
import ban3 from "./ban3.png";

const header = () => {
  return (
    <Carousel variant="light">
      <Carousel.Item>
        <img className="d-block w-100" src={ban1} alt="First slide" />
      </Carousel.Item>
      <Carousel.Item>
        <img className="d-block w-100" src={ban2} alt="Second slide" />
        <Carousel.Caption>
          <h5>Second slide label</h5>
          <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
        </Carousel.Caption>
      </Carousel.Item>
      <Carousel.Item>
        <img className="d-block w-100" src={ban3} alt="Third slide" />
        <Carousel.Caption>
          <h5>Third slide label</h5>
          <p>Praesent commodo cursus magna, vel scelerisque nisl consectetur.</p>
        </Carousel.Caption>
      </Carousel.Item>
    </Carousel>
  );
};

export default header;
